import React, { useEffect, useState } from 'react';

const Googlemap = () => {
  const [originPlaceId, setOriginPlaceId] = useState("");
  const [destinationPlaceId, setDestinationPlaceId] = useState("");
  const [travelMode, setTravelMode] = useState("WALKING");
  const [directionsRenderer, setDirectionsRenderer] = useState(null);

  useEffect(() => {
    // 구글 맵을 로드하는 함수를 정의합니다.
    const initMap = () => {
      const script = document.createElement("script");
      script.src = `https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY&libraries=places&callback=initMapCallback`;
      script.async = true;
      script.defer = true;
      window.initMapCallback = () => {
        delete window.initMapCallback;
        const maps = window.google.maps;
        const map = new maps.Map(document.getElementById("map"), {
          mapTypeControl: false,
          center: { lat: -33.8688, lng: 151.2195 },
          zoom: 13,
        });

        const directionsRenderer = new maps.DirectionsRenderer();
        directionsRenderer.setMap(map);
        setDirectionsRenderer(directionsRenderer);

        const originInput = document.getElementById("origin-input");
        const destinationInput = document.getElementById("destination-input");
        const modeSelector = document.getElementById("mode-selector");

        const originAutocomplete = new maps.places.Autocomplete(
          originInput,
          { fields: ["place_id", "description"] },
        );

        const destinationAutocomplete = new maps.places.Autocomplete(
          destinationInput,
          { fields: ["place_id", "description"] },
        );

        setupClickListener("changemode-walking", maps.TravelMode.WALKING);
        setupClickListener("changemode-transit", maps.TravelMode.TRANSIT);
        setupClickListener("changemode-driving", maps.TravelMode.DRIVING);
        setupPlaceChangedListener(originAutocomplete, "ORIG");
        setupPlaceChangedListener(destinationAutocomplete, "DEST");

        map.controls[maps.ControlPosition.TOP_LEFT].push(originInput);
        map.controls[maps.ControlPosition.TOP_LEFT].push(destinationInput);
        map.controls[maps.ControlPosition.TOP_LEFT].push(modeSelector);
      };
      script.onerror = () => {
        alert("Google Maps API를 불러오는 데 실패했습니다.");
      };
      document.head.appendChild(script);
    };

    // Google Maps API를 이미 로드한 경우에는 바로 initMap을 호출합니다.
    if (window.google && window.google.maps && window.google.maps.places) {
      initMap();
    }
  }, []);

  const setupClickListener = (id, mode) => {
    const radioButton = document.getElementById(id);

    radioButton.addEventListener("click", () => {
      setTravelMode(mode);
      route();
    });
  };

  const setupPlaceChangedListener = (autocomplete, mode) => {
    autocomplete.bindTo("bounds", window.google.maps);
    autocomplete.addListener("place_changed", () => {
      const place = autocomplete.getPlace();

      if (!place.place_id) {
        window.alert("Please select an option from the dropdown list.");
        return;
      }

      if (mode === "ORIG") {
        setOriginPlaceId(place.place_id);
      } else {
        setDestinationPlaceId(place.place_id);
      }

      route();
    });
  };

  const route = () => {
    if (!originPlaceId || !destinationPlaceId || !directionsRenderer) {
      return;
    }

    const directionsService = new window.google.maps.DirectionsService();
    directionsService.route(
      {
        origin: { placeId: originPlaceId },
        destination: { placeId: destinationPlaceId },
        travelMode: travelMode,
      },
      (response, status) => {
        if (status === "OK") {
          directionsRenderer.setDirections(response);
        } else {
          window.alert("Directions request failed due to " + status);
        }
      },
    );
  };

  useEffect(() => {
    if (window.google && window.google.maps && window.google.maps.places) {
      initMap();
    }
  }, []);

  return (
    <div>
      <input id="origin-input" placeholder="출발지" />
      <input id="destination-input" placeholder="목적지" />
      <div id="mode-selector">
        <input
          type="radio"
          name="type"
          id="changemode-walking"
          defaultChecked
        />
        <label htmlFor="changemode-walking">도보</label>
        <input type="radio" name="type" id="changemode-transit" />
        <label htmlFor="changemode-transit">대중교통</label>
        <input type="radio" name="type" id="changemode-driving" />
        <label htmlFor="changemode-driving">자동차</label>
      </div>
      <div id="map" style={{ height: "400px", width: "100%" }}></div>
    </div>
  );
};

export default Googlemap;
